import { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      name: {firstname: 'Torikus', lastname : 'Sadik'} ,
      company : 'lazy coders',
    };
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p>Assalamu alaikum, {this.state.name.firstname} {this.state.name.lastname}, I work at {this.state.company}</p>
          <button
            onClick={() => {
              this.setState(
                () => {
                  return {
                    name : {firstname : 'Abdul', lastname: 'Halim'},
                    company : 'busy coders'
                  }
                },
                () => {
                  console.table(this.state)
                }
              );
            }}>
            Friend 1 
          </button>

          <button onClick={() => {
            this.setState(
              () => {
                return(
                  name: {}
                )
              }
            )
          }}>Friend 2 </button>



          <img src={logo} className="App-logo" alt="logo" />
        </header>
      </div>
    );
  }
}

export default App;
